  const { token, message } = req.body;

  try {
    const tokens = [token];

    const notificationData = {
      notification: {
        title: 'New message',
        body: message,
      },
    };

    const options = {
      priority: 'high',
    };

    sendNotificationToClient(tokens, notificationData, options);
    res.status(200).send(`Success ${message}`);
  } catch (err) {
    res.status(200).send('err', err);
  }
});

